    false,nt"url": null,nt"notes": "  Edge refers to the linear topological
    primitives that make up MTDB.  The All Lines Shapefile contains linear features
    such as roads, railroads, andn               hydrography.  Additional attribute
    data associated with the linear features found in the All Lines Shapefile are available
    in relationship (.dbf) filesn               that users must download separately.
     The All Lines Shapefile contains the geometry and attributes of each topological
    primitive edge.  Each edge has an               unique TIGER/Line identifier (TLID)
    value.  n               n               The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from then               U.S. Census Bureau's Master Address File / Topologically
    Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB).  The
    MTDB representsn               a seamless national file with no overlaps or gaps
    between parts, however, each TIGER/Line shapefile is designed to stand alone as
    an independent datan               set, or they can be combined to cover the entire
    nation.n            ",nt"license_title": null,nt"extras": [{ntt"key":
